import React from "react";
import ShowCart from "./ShowCart";
import IMAGE_NOT_FOUND from "../../images/notfound.png";
const ShowGrid = ({ data }) => {
  return (
    <div>
      {data.map(({ show }) => (
        <ShowCart
          key={show.id}
          id={show.id}
          name={show.name}
          image={show.image ? show.image.medium : IMAGE_NOT_FOUND}
        />
      ))}
    </div>
  );
};

export default ShowGrid;
